import React from 'react';

export interface Categori {
    id: number,
    name: string
}
const CategoryCard = (category:Categori) => {
    return (
        <>
            <div className='bg-gray-300 rounded-[10px]'>{category.name}</div>
        </>
    )
}

export default CategoryCard;
